        //         placeholder='Enter first and last name'/>
        //     </Form.Group>
        //     <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
        //         <Form.Label>Working at</Form.Label>
        //         <Form.Control type='text'
        //         placeholder='Enter your company name' />
        //     </Form.Group>
        //     <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
        //         <Form.Label>Email Id</Form.Label>
        //         <Form.Control type='text'
        //         placeholder='Email address' />
        //     </Form.Group>
        //     <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
        //         <Form.Label>Designation</Form.Label>
        //         <Form.Control type='text'
        //         placeholder='Briefly describe the role' />
        //     </Form.Group>
        //     <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
        //         <Form.Label>Feedback</Form.Label>
        //         <Form.Control type='text'
        //         name='message'
        //         placeholder='Briefly rate your experience' />
        //     </Form.Group>
        //     <Button className="bg-secondary" as="input" type="submit" value="Submit" />
        // </Form>
        // </div>
        <div style={{padding: '4% 0% 10% 0%', textAlign: 'center', backgroundColor: '#ffffff'}}>
            <h1 style={{color: 'black'}}>
                Contact
            </h1>
            <br/>
            <Form style={{margin: '0% 20%', backgroundColor: '#ebebeb', padding: '2%', borderRadius: '6px'}}>
                <Form.Group className="mb-3" controlId="formBasicEmail">
                    <Form.Label>Full Name</Form.Label>
                    <Form.Control type='text' placeholder="Enter Full Name" />
                </Form.Group>
                <Form.Group className="mb-3" controlId="formBasicEmail">
                    <Form.Label>Email address</Form.Label>
                    <Form.Control type="email" placeholder="Enter email" />
                </Form.Group>

                <Form.Group className="mb-3" controlId="formBasicPassword">
                    <Form.Label>Feedback</Form.Label>
                    <Form.Control as="textarea" placeholder="Enter message" rows={6} />
                </Form.Group>
                <Button style={{backgroundColor: '#000000', color: '#FEFFFF'}} type="submit">
                    Submit
                </Button>
                </Form> 
        </div>

    );

}
export default Reviewform;
